column8:
　専用コントローラーを使って赤外線で遠隔操作ができる！<br>プラレールアドバンスを更に楽しみたい方はもちろん、初めての方にも最適な福箱が登場です。<br>

【セット内容】<br>
■超電導リニアＬ０系高架レールセット<br>
■ＡＣＳ－０１　ＩＲコントロールユニット<br>
■ＡＳ－０８　Ｃ５７　ＳＬやまぐち号<br>
■ＡＳ－１０　Ｎ７００系みずほさくらＡＣＳ<br>
■ＡＳ－１４　Ｄ５１　２００号機　ＡＣＳ<br><br>

●対象年齢：6歳から<br>
●電池種別 :単4形アルカリ乾電池（別売）<br><br>
※こちらの商品は袋には入っておりません。<br>
梱包用の箱にて出荷となります。<br>
※こちらの商品はラッピング不可です。<br>
